.CODE
MAIN PROC FAR
		
	              mov       ax, @data
	              mov       DS, ax
	              mov       ES,ax

	;open graphics mode
	              mov       ax, 0013h
	              INT       10h

	              DrawImg   BackGroundImg,BackGroundHeigh,BackGroundWidth,Ball_X,Ball_Y
	LP:           
	              clearArea Ballsize, BallSize, Ball_Y, Ball_X
	              INC       Ball_X
	              INC       Ball_Y
	              DrawImg   BallImg, Ballsize, Ballsize, Ball_Y, Ball_X
	              Delay     1,255
	              JMP       LP
           



	;end program
	              mov       ah,4
	              int       21h
MAIN ENDP



Draw Proc  Near
	              pop       IP_Pointer_Temp                                            	;store ip pointer for return
	              pop       HorizontalOffset                                           	;popping data from stack
	              pop       VerticalOffset
	              pop       AreaWidth
	              pop       AreaHeight
	              pop       bx                                                         	;Carry Img data pointer

	;setting interrupt configurations
	              MOV       CX, AreaWidth
	              MOV       DX, AreaHeight
	              add       cx,VerticalOffset
	              add       dx,HorizontalOffset
	              mov       di,bx
	              jmp       StartDrawing

	Drawit:       
	              MOV       AH,0Ch                                                     	;draw pixel
	              mov       al, [DI]                                                   	;color of current pixel
	              cmp       al,0                                                       	;if pixel is empty
	              jz        StartDrawing                                               	;skip
	              MOV       BH,00h                                                     	;set page number
	              INT       10h
	;call dddd
	StartDrawing: 
	              inc       DI                                                         	;move to next pixel
	              DEC       Cx
	              cmp       cx,VerticalOffset
	              JNZ       Drawit
	              mov       Cx, AreaWidth
	              add       cx,VerticalOffset
	              DEC       DX
	              cmp       dx,HorizontalOffset
	              JZ        ENDDrawing
	              Jmp       Drawit

	ENDDrawing:   
	              push      IP_Pointer_Temp
	              RET
draw endp


dddd proc
	              push      ax
	              push      bx
	              push      cx
	              push      dx
	              delay     0,1
	              pop       dx
	              pop       cx
	              pop       bx
	              pop       ax
	              RET
dddd endp

Clear Proc  Near
	              pop       IP_Pointer_Temp                                            	;store ip pointer for return
	              pop       HorizontalOffset
	              pop       VerticalOffset
	              pop       AreaWidth
	              pop       AreaHeight

	;setting interrupt configurations
	              MOV       CX, AreaWidth
	              MOV       DX, AreaHeight
	              add       cx,VerticalOffset
	              add       dx,HorizontalOffset
	              mov       di,bx
	              jmp       StartClearing

	Clearit:      
	              MOV       AH,0Ch                                                     	;draw pixel mode
	              mov       al,BGC                                                     	;draw pixel with background color
	              MOV       BH,00h                                                     	;page number
	              INT       10h
	StartClearing:
	              inc       DI                                                         	;move to next pixel
	              DEC       Cx
	              cmp       cx,VerticalOffset
	              JNZ       Clearit
	              mov       Cx, AreaWidth
	              add       cx,VerticalOffset
	              DEC       DX
	              cmp       dx,HorizontalOffset
	              JZ        EndClearing
	              Jmp       Clearit

	EndClearing:  
	              push      IP_Pointer_Temp
	              RET
Clear endp



